import React from "react";
import Navbar from "./Navbar.js";
import "./App.css";
import Button from "@material-ui/core/Button";

function App() {
  return (
    <div>
      <Navbar />
      <Button variant="contained" color="primary">
        Hello World
      </Button>
    </div>
  );
}

export default App;
